import React from "react";
import { ImageBackground, StyleSheet, Text, View } from "react-native";

export default function App() {
  return (
    <View>
      <ImageBackground
        source={require("./assets/BG_Gradient.png")}
        style={{ flex: 1 }}
      ></ImageBackground>
    </View>
  );
}
